import React, { useState, } from 'react';
import API from "../utils/API";
import { Button, Card } from 'react-bootstrap';


let itemsincart = [];
API.loadCart(itemsincart)
console.log(itemsincart);
function Cart() {
  return (
    <React.Fragment> 
      <center><h1>Cart Page</h1></center>

      <Card style={{ width: '18rem' }}>
          <Card.Img variant="top" src="{image}" />
          <Card.Body>
            <Card.Title>{itemsincart.name}</Card.Title>
            <Card.Text>{itemsincart.saleprice}</Card.Text>
            <Button variant="primary" href={itemsincart.link}>Item Link</Button>
          </Card.Body>
        </Card>

    </React.Fragment>
   );
}

export default Cart;
